import React, { useEffect, useRef } from "react";
import Bird from "./Bird";
import Empty from "./Empty";

const ObjectCreatorBird = React.forwardRef(({ objectIndex }, ref) => {
    useEffect(() => {
        const ObjectCreatorBirdElement = ref.current;
        if (ObjectCreatorBirdElement) {
            const { width, height } = ObjectCreatorBirdElement.getBoundingClientRect();
            console.log("Размер ObjectCreator:", width, height);
        }
    }, [ref]);

    if (objectIndex >= 0 && objectIndex <= 94) {
        return <Empty ref={ref} />;
    } else if (objectIndex >= 95 && objectIndex <= 99) {
        return <Bird ref={ref} />;
    } else {
        return null;
    }
});

export default ObjectCreatorBird;
